import React, { Component, PropTypes } from 'react';
import Helmet from 'react-helmet';

export default class NotFoundPage extends Component {
  render() {

    return (
      <div>
        <Helmet title="页面不存在" />
        <div style={{width: '80%', textAlign: 'center', margin: '0 auto'}}>
          <div style={{margin: '50px 0 80px 0'}}>
            <img style={{width: '100%'}}
              src="data:image/png;base64,"
            />
          </div>
          <a href="javascript:history.back()"
            style={{
              width: '50%',
              height: '40px',
              margin: '0 auto',
              textDecoration: 'none',
              lineHeight: '40px',
              display: 'block',
              color: '#ff3976',
              borderRadius: '5px',
              border:'1px solid #ff3976',
              fontSize: '18px'
            }}
          >返回</a>
        </div>
      </div>
    )
  }
}
